import React from "react";

const Navbar = () => {
  return (
    <div className="container flex w-full justify-between ">
      <h1 className="text-3xl font-bold text-green-400">REACT APP</h1>
      <ul className="flex">
        <li>Home</li>
        <li>About</li>
        <li>Porfolio</li>
        <li>Project</li>
      </ul>
    </div>
  );
};

export default Navbar;
